import React from "react";

export const Swedish = () => {
  return (
    <div>
      <h3 className="text">• Om mig •</h3>
      <div className="swe_om">
        <p>
          Driven lagspelare med stort intresse för IT och ny teknik. Lång
          erfarenhet från ekonomistyrning och bra på att strukturera och
          effektivisera mitt arbete, även erfarenhet från inköp och
          projektarbete samt kund-, leverantörs- och myndighetskontakt. Gillar
          problemlösning, felsökning och automatisering inom data, IT och
          nätverk.
        </p>
      </div>
    </div>
  );
};
